import React, { useState } from 'react';
import axios from '.axios';

const Check = () => {
  const [url, setUrl] = useState('');
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleUrlChange = (e) => {
    setUrl(e.target.value);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!url) {
      return;
    }

    setLoading(true);

    try {
      const response = await axios.post('/check-url', { url });
      setResult(response.data.result);
    } catch (error) {
      console.error('An error occurred:', error);
    }

    setLoading(false);
  };

  const renderResultMessage = () => {
    if (result && result.data && result.data.attributes) {
      const { last_analysis_stats } = result.data.attributes;
      const isSafe = last_analysis_stats && last_analysis_stats.malicious === 0;

      return isSafe ? 'The URL is safe.' : 'The URL is not safe.';
    }

    return null;
  };

  return (
    <div>
      <h2>URL Name Check</h2>
      <form onSubmit={handleSubmit}>
        <input type="text" value={url} onChange={handleUrlChange} placeholder="Enter URL" />
        <button type="submit" disabled={loading}>
          {loading ? 'Checking...' : 'Check'}
        </button>
      </form>
      {result && (
        <div>
          <h3>Result:</h3>
          <pre>{JSON.stringify(result, null, 2)}</pre>
          <p>{renderResultMessage()}</p>
        </div>
      )}
    </div>
  );
};

export default Check;
